@etam is launching their first US store in miami this Summer and I’m already obsessed with their lingerie ✨

to celebrate the launch, they’re offering you a chance to go to Paris for fashion week, behind the scenes access to a runway show, AND a $500 shopping spree. Plus you can be featured in their new store!

to enter, share your French-inspired Fashion Week look and tag @etam and #EtamTakeMeToParis on IG or TikTok ❤️
